angular.module('sixcloudAdminApp').controller('MyAccountController', ['$timeout', 'adminfactory', '$http', '$scope', '$timeout', '$rootScope', '$filter', function($timeout, adminfactory, $http, $scope, $timeout, $rootScope, $filter) {
    console.log('my account controller loaded');
    $(".single-datepicker,input[name='dob']").daterangepicker({
        singleDatePicker: true,
        showDropdowns: true
    });
    $scope.submitProfile = function() {
        var formData = new FormData($("#edit_admin_profile")[0]);
        formData.append("file_upload", $scope.myCroppedImage);
        formData.append("x1", $scope.image.cropInfo.x);
        formData.append("y1", $scope.image.cropInfo.y);
        formData.append("w", $scope.image.cropInfo.width);
        formData.append("h", $scope.image.cropInfo.height);
        adminfactory.Editadminprofile(formData).then(function(response) {
            if (response.data.status == 1) {
                simpleAlert('success', 'Edit Profile', response.data.message, true);
                $("#edit_admin_profile")[0].reset();
                $rootScope.ADMINDATA.first_name = formData.get('first_name');
                $rootScope.ADMINDATA.last_name = formData.get('last_name');
                if (response.data.data != '') {
                    $scope.adminData.image = response.data.data;
                    $rootScope.ADMINDATA.image = response.data.data;
                }
            }
        });
    }
    adminfactory.Userdata().then(function(response) {
        if (response.data.status == 1) {
            $scope.adminData = response.data.data;
        } else {
            window.location.href = BASEURL + 'manage/login';
        }
    });
    $scope.Updatepassword = function(passwords) {
        if (passwords.password == passwords.cnf_password) {
            adminfactory.Changepassword({
                'passwords': passwords
            }).then(function(response) {
                if (response.data.status == 1) {
                    simpleAlert('success', 'redirecting...', response.data.message, false);
                    $timeout(location.reload(), 3000);
                } else {
                    simpleAlert('error', 'Error', response.data.message);
                    $scope.passwords = {};
                }
            });
        } else {
            simpleAlert('error', 'Error', 'Password and confirm password does not match');
        }
    }
    $scope.image = {
        originalInfo: {},
        cropInfo: {
            x: 133,
            y: 17,
            width: 451,
            height: 451
        }
    };
    var handleFileSelect = function(evt) {
        var file = evt.currentTarget.files[0];
        var reader = new FileReader();
        reader.onload = function(evt) {
            $scope.$apply(function($scope) {
                $scope.imageDataURI = evt.target.result;
            });
        };
        reader.readAsDataURL(file);
    };
    angular.element(document.querySelector('#image')).on('change', handleFileSelect);
    // everything below is just base64 image jargon...
    $scope.imageDataURI = 'data:image/jpeg;base64,';
}]);